import React from "react";
import './Region.css';

function Region() {
    return (
        <ul class="content__region__block__list">
            <li>Africa</li>
            <li>America</li>
            <li>Asia</li>
            <li>Europe</li>
            <li>Oceania</li>
        </ul>
    )
}

export default Region;
